import './App.css';
import Nav from './nav.js';
import PopularRecipies from './popularRecipies.js';

const apiKey = '1'; // Test API key

// Function to get all meal categories
const getAllMealCategories = async () => {
  const apiUrl = `https://www.themealdb.com/api/json/v1/${apiKey}/categories.php`;
  
  try {
    const response = await fetch(apiUrl);
    
    if (!response.ok) {
      throw new Error(`HTTP error! Status: ${response.status}`);
    }

    const data = await response.json();
    
    // Handle the API response
    console.log(data.categories);
  } catch (error) {
    console.error('Error fetching data:', error.message);
  }
};

// Call the function to get all meal categories
getAllMealCategories();

function App() {
  return (
    
    <div className="App md:overflow-visible overflow-hidden">
      <Nav style={{ zIndex: '999' }} />
      <PopularRecipies />
    </div>

  );
}

export default App;
